B.BV=new A.cb("text",'<b>\xbfQu\xe9 es Flutter?</b>\n<p>Flutter es tu caja de herramientas para construir aplicaciones hermosas y r\xe1pidas. Utiliza el lenguaje Dart que aprendiste en el M\xf3dulo 1 para crear interfaces que funcionan en Android, iOS, web y m\xe1s, todo desde un mismo c\xf3digo.</p>\n<li><b>El Principio "Todo es un Widget":</b> En Flutter, cada elemento visual es una pieza de Lego llamada "Widget". Un texto, un bot\xf3n, una imagen, e incluso la forma en que organizas los elementos, son todos widgets.</li>\n<li><b>Hot Reload:</b> Es la caracter\xedstica m\xe1gica de Flutter. Te permite ver los cambios que haces en el c\xf3digo reflejados en la app casi al instante, haciendo el proceso de dise\xf1o mucho m\xe1s r\xe1pido y divertido.</li>\n')
