B.BY=new A.cb("text","<b>\xa1Bienvenido al mundo de la programaci\xf3n!</b>\n<p>Imagina que quieres darle instrucciones a una computadora. No puedes hablarle como a una persona; necesitas un idioma especial. Eso es un lenguaje de programaci\xf3n. En este curso, aprender\xe1s <b>Dart</b>, el lenguaje que usa Flutter para crear apps incre\xedbles.</p>\n<li><b>Tu Entorno de Trabajo:</b> Para empezar, usaremos <code>dartpad.dev</code> (puedes acceder en https://dartpad.dev/), un 'cuaderno' online donde puedes escribir y probar tu c\xf3digo sin instalar nada. \xa1Es perfecto para practicar!</li>\n<li><b>Tu Primera Orden:</b> Toda aplicaci\xf3n en Dart empieza en un punto llamado <code>void main()</code>. Dentro, usaremos el comando <code>print('Hola, Mundo!');</code> para darle nuestra primera instrucci\xf3n a la computadora: mostrar ese texto en pantalla.</li>\n")
B.BZ=new A.cb("text","<b>Comunicaci\xf3n con APIs REST y Pruebas</b>\n<p>La mayor\xeda de las apps no viven aisladas; necesitan obtener datos de internet. Esto se hace a trav\xe9s de APIs.</p>\n<li><b>Consumo de API:</b> Usando el paquete <code>http</code>, tu app puede hacer peticiones a un servidor para obtener datos (ej. el pron\xf3stico del tiempo) o enviar informaci\xf3n (ej. publicar una foto).</li>\n<li><b>JSON y Modelos:</b> Las APIs suelen responder con datos en formato JSON. Aprender\xe1s a convertir este texto en objetos de Dart (modelos de datos) para poder usar la informaci\xf3n de forma f\xe1cil y segura.</li>\n<li><b>Pruebas Unitarias:</b> Son peque\xf1as pruebas que escribes para verificar que una pieza de tu c\xf3digo (como una funci\xf3n o una clase) funciona como esperas. Son cruciales para asegurar la calidad y evitar errores.</li>\n")
B.C_=new A.cb("image","assets/images/module_5_api_testing.png")
B.C0=new A.cb("text","<b>Estructura y Despliegue del Proyecto</b>\n<p>Tener un c\xf3digo bien organizado y saber c\xf3mo publicarlo es tan importante como escribirlo.</p>\n<li><b>Mejores Pr\xe1cticas:</b> Aprender\xe1s a estructurar las carpetas y archivos de tu proyecto para que sea f\xe1cil de mantener y escalar.</li>\n<li><b>Optimizaci\xf3n:</b> Descubrir\xe1s t\xe9cnicas para que tu app funcione de manera m\xe1s fluida, como usar <code>const</code> para widgets que no cambian.</li>\n<li><b>Despliegue:</b> Finalmente, aprender\xe1s los pasos para compilar tu aplicaci\xf3n y prepararla para ser publicada en tiendas como la Google Play Store (para Android).</li>\n")
B.C1=new A.cb("text",'<b>\xbfQu\xe9 es el Design Thinking?</b>\n<p>Antes de escribir una sola l\xednea de c\xf3digo, los mejores desarrolladores se preguntan: "\xbfQu\xe9 problema estoy resolviendo y para qui\xe9n?". El Design Thinking es una metodolog\xeda para responder a esa pregunta. Es una forma de trabajar en grupo que maximiza la creatividad para encontrar soluciones que la gente realmente quiera usar.</p>\n<li><b>Centrado en la Persona:</b> El coraz\xf3n de esta metodolog\xeda es entender profundamente a las personas. Si no dise\xf1as para ellas, tu app no tendr\xe1 \xe9xito.</li>\n<li><b>Iterativo y Experimental:</b> No es un camino recto. Es un ciclo de probar, fallar, aprender y mejorar. Los errores son oportunidades para aprender.</li>\n<li><b>Colaborativo:</b> Se basa en el trabajo en equipo, donde personas con diferentes puntos de vista aportan ideas para crear una soluci\xf3n m\xe1s completa.</li>\n')
B.C2=new A.cb("image","assets/images/module_5_deployment.png")
