B.C4=new A.cb("text","<b>IA en el Ciclo de Desarrollo de Software</b>\n<p>La Inteligencia Artificial (IA) ya no es solo para generar ideas; es un asistente poderoso en cada etapa del desarrollo. La IA generativa y los modelos de lenguaje grandes (LLM) pueden automatizar tareas, desde analizar requisitos hasta generar c\xf3digo y casos de prueba.</p>\n<li><b>Dise\xf1o y Planificaci\xf3n:</b> La IA puede sugerir arquitecturas de software, dise\xf1os de interfaz de usuario (UI/UX) y generar maquetas basadas en tus descripciones.</li>\n<li><b>Desarrollo:</b> Herramientas como GitHub Copilot pueden autocompletar tu c\xf3digo, generar funciones enteras a partir de un comentario y ayudarte a detectar errores m\xe1s r\xe1pido.</li>\n<li><b>Pruebas:</b> La IA puede generar casos de prueba autom\xe1ticamente, asegurando que tu c\xf3digo sea m\xe1s robusto y confiable.</li>\n")
B.C5=new A.cb("text","<b>Tomando Decisiones: Control de Flujo</b>\n<p>A veces, queremos que nuestro programa haga una cosa u otra dependiendo de una condici\xf3n. Para eso usamos <code>if</code> (si) y <code>else</code> (si no).</p>\n<li><b>Ejemplo:</b> <code>if (miEdad > 18) { print('Eres mayor de edad'); } else { print('Eres menor de edad'); }</code>. Esto es como decir: \"Si la edad en la caja es mayor a 18, di una cosa. Si no, di otra\".</li>\n<b>Organizando Datos: Colecciones</b>\n<p>\xbfY si queremos guardar varias cosas juntas? Usamos colecciones.</p>\n<li><b>Listas (<code>List</code>):</b> Como una lista de compras. Es una colecci\xf3n ordenada de elementos. <code>List<String> compras = ['Leche', 'Pan'];</code></li>\n")
B.C6=new A.cb("text",'<b>Widgets Est\xe1ticos vs. Din\xe1micos</b>\n<p>Hay dos tipos principales de widgets que usar\xe1s constantemente.</p>\n<li><b><code>StatelessWidget</code> (Widget Est\xe1tico):</b> Es como una foto. Una vez que lo creas, no cambia. Es perfecto para t\xedtulos, \xedconos o cualquier elemento que no necesite interactuar con el usuario.</li>\n<li><b><code>StatefulWidget</code> (Widget Din\xe1mico):</b> Es como un interruptor de luz. Puede cambiar su "estado" (su memoria interna). Lo usamos para cosas que deben reaccionar a la interacci\xf3n, como un contador que aumenta o un campo de texto que guarda lo que escribes. Para actualizar la pantalla, usamos el m\xe9todo <code>setState()</code>.</li>\n')
