B.Ca=new A.cb("text",'<b>Las 5 Etapas del Proceso</b>\n<p>El Design Thinking se divide en 5 fases que te gu\xedan desde el problema hasta la soluci\xf3n.</p>\n<li><b>1. Empatizar:</b> La primera fase es "ponerse en los zapatos del otro". El objetivo es comprender verdaderamente a los usuarios, sus necesidades, deseos y frustraciones. Se usan t\xe9cnicas como entrevistas o el "mapa de empat\xeda".</li>\n<li><b>2. Definir:</b> Despu\xe9s de entender al usuario, sintetizas toda la informaci\xf3n para definir claramente cu\xe1l es el problema principal que vas a resolver.</li>\n<li><b>3. Idear:</b> \xa1Aqu\xed es donde ocurre la magia! Es una lluvia de ideas sin l\xedmites para generar la mayor cantidad de soluciones posibles, sin juzgar si son buenas o malas.</li>\n<li><b>4. Prototipar:</b> Transformas tus mejores ideas en versiones simples y tangibles. Puede ser un simple dibujo en papel o una maqueta interactiva. El objetivo es crear algo que los usuarios puedan probar.</li>\n<li><b>5. Testear:</b> Pones tus prototipos en manos de usuarios reales para obtener su opini\xf3n. Esta retroalimentaci\xf3n es oro puro para saber qu\xe9 funciona, qu\xe9 no, y c\xf3mo mejorar tu soluci\xf3n.</li>\n')
B.Cb=new A.cb("text",'<b>Gesti\xf3n de Estado Avanzada</b>\n<p>Cuando tu app crece, manejar el "estado" (los datos que cambian) con <code>setState()</code> puede volverse ca\xf3tico. Necesitamos herramientas m\xe1s potentes para mantener el c\xf3digo organizado.</p>\n<li><b>\xbfEl Problema?:</b> Imagina que muchas partes de tu app necesitan saber si el usuario ha iniciado sesi\xf3n. Pasar esa informaci\xf3n manualmente a cada pantalla es ineficiente y propenso a errores.</li>\n<li><b>La Soluci\xf3n:</b> Gestores de estado como <b>Provider</b>, <b>Riverpod</b> o <b>BLoC</b> act\xfaan como una fuente central de verdad. Cualquier widget que necesite un dato, simplemente se suscribe a \xe9l y se actualiza autom\xe1ticamente cuando cambia.</li>\n')
B.Cc=new A.cb("image","assets/images/module_4_ai_copilot.png")
B.Cd=new A.cb("text",'<b>Ingenier\xeda de Prompts: Hablando con la IA</b>\n<p>La Ingenier\xeda de Prompts es el arte de dise\xf1ar instrucciones (prompts) claras y efectivas para que los modelos de IA generen exactamente lo que necesitas. Es una habilidad clave para cualquier desarrollador moderno.</p>\n<li><b>Claridad y Especificidad:</b> Un buen prompt es detallado. En lugar de pedir "c\xf3digo para un bot\xf3n", pide "c\xf3digo en Flutter para un ElevatedButton azul, con texto \'Aceptar\' en blanco y bordes redondeados".</li>\n<li><b>Estructura y Contexto:</b> Dale contexto a la IA. Explica la situaci\xf3n, luego haz la pregunta y finalmente indica el formato que esperas.</li>\n<li><b>Iteraci\xf3n y Verificaci\xf3n:</b> El primer resultado de la IA no siempre es perfecto. Es un proceso de experimentar, refinar tu prompt y siempre revisar cr\xedticamente el c\xf3digo generado. \xa1La IA puede cometer errores!</li>\n')
