B.Cg=new A.cb("text",'<b>Del Design Thinking al Prompt</b>\n<p>Aqu\xed es donde todo se conecta. Las ideas y problemas que definiste en el M\xf3dulo 3 son la materia prima perfecta para tus prompts.</p>\n<li><b>Ejemplo:</b> Si en la fase de "Definir" llegaste a la pregunta "\xbfC\xf3mo podr\xedamos ayudar a los usuarios a decidir qu\xe9 pel\xedcula ver?", puedes usarla para crear prompts como: "Genera 5 ideas de caracter\xedsticas para una app que recomienda pel\xedculas" o "Escribe una funci\xf3n en Dart que reciba una lista de pel\xedculas y la filtre por g\xe9nero".</li>\n')
B.Ch=new A.cb("text",'<b>Organizando tu Interfaz</b>\n<p>Flutter te da widgets especiales para organizar tus "piezas de Lego" en la pantalla.</p>\n<li><b><code>Scaffold</code>:</b> Es el esqueleto principal de tu pantalla. Te da una estructura con lugares listos para una barra superior (<code>AppBar</code>) y el contenido principal (<code>body</code>).</li>\n<li><b><code>Column</code> y <code>Row</code>:</b> Son tus mejores amigos para el dise\xf1o. Usa <code>Column</code> para apilar widgets uno encima de otro (verticalmente) y <code>Row</code> para ponerlos uno al lado del otro (horizontalmente).</li>\n<li><b><code>Expanded</code>:</b> Un widget muy \xfatil dentro de <code>Row</code> o <code>Column</code> que le dice a su hijo que ocupe todo el espacio disponible. \xa1Perfecto para evitar errores de overflow!</li>\n<li><b>Creando tus Propios Widgets:</b> Para mantener tu c\xf3digo limpio, puedes encapsular una parte de tu UI en su propia clase de widget y reutilizarla donde la necesites.</li>\n')
B.Ci=new A.cb("text","<b>Guardando Informaci\xf3n: Variables</b>\n<p>Piensa en las variables como cajas con etiquetas. En estas cajas guardamos datos para usarlos m\xe1s tarde. Cada caja est\xe1 dise\xf1ada para un tipo de dato espec\xedfico.</p>\n<li><b><code>String</code>:</b> Cajas para guardar texto. Por ejemplo: <code>String miNombre = 'Ana';</code></li>\n<li><b><code>int</code>:</b> Cajas para guardar n\xfameros enteros. Por ejemplo: <code>int miEdad = 30;</code></li>\n<li><b><code>double</code>:</b> Cajas para n\xfameros con decimales. Por ejemplo: <code>double miAltura = 1.75;</code></li>\n<li><b><code>bool</code>:</b> Cajas que solo guardan 'verdadero' (<code>true</code>) o 'falso' (<code>false</code>). Son como un interruptor de luz.</li>\n")
