B.Cj=new A.n4("Actividad Pr\xe1ctica: Tu Primer Copiloto de IA","Utilizar una herramienta de IA para generar un widget de Flutter a partir de un prompt detallado.","GitHub Copilot (en VS Code), o un LLM como Gemini o ChatGPT.","<li><b>1. Define el Requisito:</b> Quieres crear una \"Tarjeta de Pel\xedcula\" para una app. Debe mostrar un t\xedtulo, el a\xf1o de estreno y un p\xf3ster.</li>\n<li><b>2. Escribe el Prompt:</b> En un archivo Dart, escribe un comentario detallado (un prompt) que describa el widget. Por ejemplo: <code>// Crea un StatelessWidget en Flutter llamado 'MovieCard'. Debe recibir un t\xedtulo (String), un a\xf1o (String) y una URL de p\xf3ster (String). Debe mostrar el p\xf3ster usando Image.network, y debajo, el t\xedtulo en negrita y el a\xf1o en un texto m\xe1s peque\xf1o.</code></li>\n<li><b>3. Genera y Analiza:</b> Usa tu herramienta de IA para generar el c\xf3digo a partir del comentario.</li>\n<li><b>4. Refina el C\xf3digo:</b> Revisa el c\xf3digo generado. \xbfEs correcto? \xbfPodr\xedas mejorarlo? Haz los ajustes necesarios para que funcione en tu aplicaci\xf3n.</li>\n")
B.Ck=new A.n4("Actividades Pr\xe1cticas del M\xf3dulo 2","Construir tus primeras interfaces de usuario en Flutter, utilizando widgets est\xe1ticos y din\xe1micos.",u.p,'<li><b>1. Tarjeta de Presentaci\xf3n (Stateless):</b> Crea una pantalla que muestre tu nombre, profesi\xf3n y una imagen de perfil. Organiza los elementos usando <code>Column</code>, <code>Row</code> y <code>Container</code>.</li>\n<li><b>2. Contador Interactivo (Stateful):</b> Implementa una pantalla con un n\xfamero y dos botones. Un bot\xf3n debe incrementar el n\xfamero y el otro debe reiniciarlo a cero. Usa <code>StatefulWidget</code> y <code>setState()</code>.</li>\n<li><b>3. Modularizaci\xf3n:</b> Extrae la "Tarjeta de Presentaci\xf3n" del paso 1 a su propio archivo y clase (un widget personalizado). Luego, imp\xf3rtala y \xfasala en tu pantalla principal.</li>\n')
B.Cl=new A.n4("Actividad Pr\xe1ctica: Dise\xf1a tu Primera App","Aplicar las 5 fases del Design Thinking para conceptualizar una soluci\xf3n a un problema cotidiano.","Papel, bol\xedgrafo, post-its (o una herramienta de pizarra digital como Miro/FigJam).",'<li><b>1. Elige un Problema:</b> Piensa en un problema simple que t\xfa o tus amigos tengan (ej. "es dif\xedcil decidir qu\xe9 pel\xedcula ver", "siempre olvido regar las plantas").</li>\n<li><b>2. Empatiza y Define:</b> Entrevista a 2-3 personas sobre ese problema. \xbfQu\xe9 sienten? \xbfQu\xe9 hacen al respecto? Luego, define el problema principal en una frase clara.</li>\n<li><b>3. Idea:</b> En 10 minutos, escribe todas las ideas de apps que se te ocurran para solucionar ese problema. \xa1No te limites!</li>\n<li><b>4. Prototipa:</b> Elige tu idea favorita y dibuja 3-4 pantallas principales de la app en papel. No tiene que ser perfecto, solo entendible.</li>\n<li><b>5. Testea:</b> Mu\xe9strale tus dibujos a una persona y expl\xedcale c\xf3mo funcionar\xeda. Pide su opini\xf3n sincera. \xbfQu\xe9 le gusta? \xbfQu\xe9 no entiende?</li>\n')
B.Cm=new A.n4('Actividad: "Mi Perfil de Programador Dart"','Crear un programa simple en Dart que defina caracter\xedsticas de un "programador", realice algunas operaciones y clasifique su perfil bas\xe1ndose en estas.',"DartPad (https://dartpad.dev/)",'<li><b>1. Prepara tu entorno en DartPad:</b> Abre dartpad.dev y selecciona "New Pad" de tipo Dart.</li>\n<li><b>2. Define tus "Datos de Programador":</b> Dentro de <code>void main()</code>, declara variables como <code>nombre</code> (String), <code>aniosExperiencia</code> (int), <code>calificacionPromedio</code> (double), y <code>leGustaFlutter</code> (bool).</li>\n<li><b>3. Realiza Operaciones:</b> Usa <code>print()</code> para mostrar la informaci\xf3n usando interpolaci\xf3n de cadenas (<code>$variable</code>). Realiza una operaci\xf3n aritm\xe9tica simple y usa un operador de incremento/decremento.</li>\n<li><b>4. Clasifica el Perfil:</b> Usa <code>if/else</code> para clasificar el nivel de experiencia y un <code>switch</code> para dar un mensaje basado en una variable <code>lenguajeFavorito</code>.</li>\n<li><b>5. Ejecuta y Experimenta:</b> Haz clic en "Run" y observa los resultados. Modifica los valores de tus variables y vuelve a ejecutar para ver c\xf3mo cambian los mensajes.</li>\n')
B.Cn=new A.n4("Actividad Pr\xe1ctica: App de Lista de Tareas","Crear una aplicaci\xf3n completa que gestione estado, consuma una API simulada y siga buenas pr\xe1cticas de estructura.",u.p,'<li><b>1. Estructura del Proyecto:</b> Organiza tu app en carpetas para modelos, vistas (pantallas) y servicios (l\xf3gica de API).</li>\n<li><b>2. Gesti\xf3n de Estado:</b> Elige un gestor de estado (como Provider) para manejar la lista de tareas. Debes poder a\xf1adir, eliminar y marcar tareas como completadas.</li>\n<li><b>3. Consumo de API (Simulado):</b> Usa <code>Future.delayed</code> para simular una llamada de red que "carga" las tareas iniciales al abrir la app. Muestra un indicador de carga mientras esperas.</li>\n<li><b>4. Pruebas Unitarias:</b> Escribe una prueba unitaria simple para tu l\xf3gica de gesti\xf3n de estado. Por ejemplo, verifica que al llamar a la funci\xf3n `addTask`, la longitud de la lista de tareas realmente aumenta en uno.</li>\n')
